import React from "react";

import Button from '@mui/material/Button';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';

import { Link } from "react-router-dom";

export default function NavBar() {
  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <nav>
        <div className="nav-wrapper">
            <div className="ColaCoLogo">
                <img 
                className="colacoLogo"
                src="https://ik.imagekit.io/0ef3zk1rums/ColaCo-ZoomedIn_XfFaP4Vq4?updatedAt=1640409185081" 
                alt="ColaCo logo" />
            </div>
            <Button
                id="basic-button"
                aria-controls="basic-menu"
                aria-haspopup="true"
                aria-expanded={open ? 'true' : undefined}
                onClick={handleClick}
                className="nav-btn"
            >
                Dashboard
            </Button>
            <Menu
                id="basic-menu"
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                MenuListProps={{
                  'aria-labelledby': 'basic-button',
                }}
            >
             {/* Home page */}
            <MenuItem onClick={handleClose}><Link to="/soda">Home</Link></MenuItem>
            {/* Account page */}
            <MenuItem onClick={handleClose}><Link to="/account">Account</Link></MenuItem>
            {/* Inventory page */}
            <MenuItem onClick={handleClose}><Link to="/inventory">Inventory</Link></MenuItem>
            </Menu>
        </div>  
    </nav>
  );
}
